import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import JetBlueNavBar from './components/JetBlueNavBar';
import WordCloud from './components/WordCloud';

const styles = {
  large: {
    fontSize: 60,
    fontWeight: 'bold'
  },
  small: {
    opacity: 0.7,
    fontSize: 16
  }
};

function App() {
  return (
      <div> 
      <JetBlueNavBar />
      <WordCloud/>
      <span>Hello</span>
      </div>
  );
}

export default App;
